import React from 'react';
import {
    Navbar,
    Nav,
    NavItem,
    NavLink,
} from 'reactstrap';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
    faInstagram,
    faTwitter,
    faFacebookSquare,
    faPinterest,
    faYoutube,
} from "@fortawesome/free-brands-svg-icons";

const Home = (props) => {

    return (

        <div>
        {/* Header */}
            <Navbar color="dark" dark expand="md">
                <Nav className="mr-auto">
                    <NavItem>
                        <NavLink href="#">Home</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">Shop</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">About</NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink href="#">Contact</NavLink>
                    </NavItem>
                </Nav>
            </Navbar>


        {/* Footer */}
        <div></div>
            <Navbar color="dark" dark expand="md" className='footer'>
                <FontAwesomeIcon icon={faFacebookSquare} color="#1777F2" />
                <FontAwesomeIcon icon={faTwitter} color="#33a7f4" />
                <FontAwesomeIcon icon={faInstagram} color="#CA5191" />
                <FontAwesomeIcon icon={faPinterest} color="#f72541" />
                <FontAwesomeIcon icon={faYoutube} color="#e5162f" />
            </Navbar>
        </div>
    );
}

export default Home;
